import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import PersonalDetails from '../PersonalDetail/PersonalDetails';
import HomeDetails from '../PersonalDetail/HomeDetails';

function TotalInfo() {
  return (
    <div>
      <Router>
        <nav>
          <Link to="/personalDetails" style={{ display: 'block' }}>Personal Details</Link>
          <Link to="/homeDetails" style={{ display: 'block' }}>Home Details</Link>
        </nav>

        <Routes>
          <Route path="/personalDetails" element={<PersonalDetails />} />
          <Route path="/homeDetails" element={<HomeDetails />} />
        </Routes>
      </Router>
    </div>
  );
}

export default TotalInfo;
